// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPopupRenderFunction } from 'js/AwPopupService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPopupService', () => import('js/AwPopupService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awPopupRenderFunction",
            "deps": "js/AwPopupService",
            "options": {
                "usePortal": true
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "options": {
            "type": "popup"
        },
        "caption": {
            "type": "string"
        },
        "commands": {
            "type": "object"
        },
        "anchor": {
            "type": "string"
        },
        "is-modal": {
            "type": "string"
        },
        "context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwPopup",
    "_uniqueViewModelId": "AwPopup",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPopupRenderFunction, {"usePortal":true}, ctxImportObj );

export default Component;
